import Document, { Head, Main, NextScript } from 'next/document';

import React from 'react';

function DocumentScript(props) {
    return (
        <div>
            <html>
                <Head>
                   
                </Head>
                <body>
                    <Main />
                    <NextScript />
                </body>
            </html>
        </div>
    );
}

export default DocumentScript;
